import { useEffect, useState } from 'react';
import axios from 'axios';
import { FormControl, InputLabel, Select, MenuItem } from '@mui/material';

export default function VehicleTypeStep({ setValue, wheels }) {
  const [vehicleTypes, setVehicleTypes] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await axios.get('http://localhost:5000/api/vehicle-types', {
          params: { wheels }
        });
        setVehicleTypes(response.data);
      } catch (error) {
        console.error('Error:', error);
      } finally {
        setLoading(false);
      }
    };
    fetchData();
  }, [wheels]);

  if (loading) return <div>Loading vehicle types...</div>;

  return (
    <FormControl fullWidth sx={{ mt: 3 }}>
      <InputLabel>Vehicle Type</InputLabel>
      <Select
        label="Vehicle Type"
        onChange={(e) => setValue('vehicleType', e.target.value)}
      >
        {vehicleTypes.map(type => (
          <MenuItem key={type.id} value={type.id}>
            {type.name}
          </MenuItem>
        ))}
      </Select>
    </FormControl>
  );
}
